<script>
import axios from 'axios'
import { mapState } from 'vuex'

export default {
  meta: {
    title: 'Simbank.pro'
  },
  data () {
    return {
      left: true,
      dialog: true,
      login: {
        username: '',
        password: ''
      },
      goip_settings: [],
      goip_lines: []
    }
  },
  created () {
    this.setAxiosConf()
  },
  computed: {
    ...mapState([
      'miniStateDrawerL',
      'miniStateDrawerR',
      'token',
      'states'
    ])
  },
  methods: {
    setAxiosConf () {
      axios.defaults.baseURL = 'http://65.21.51.17:8010/api'
      if (this.token) {
        axios.defaults.headers.common.Authorization = `Token ${this.token}`
      }
    },
    authorization(){
      const vm = this
      axios.post('/user/authorize/', vm.login).then(response => {
        axios.defaults.headers.common.Authorization = `Token ${response.data.token}`
        vm.login = {username: '', password: ''}
        this.$store.dispatch('authorize', response.data.token)
      }).catch(error => {
        console.log(error.detail)
        vm.showNotify('top-right', 'Не верный логин или пароль', 'negative')
      })
    },
    logOut () {
      const vm = this
      vm.$store.dispatch('authorize', '')
    },
    showNotify (position, message, color) {
      this.$q.notify({
        color: color, 
        textColor: 'white', 
        message: message, 
        position: position,
        timeout: 3000
      })
    }
  },
  mounted () {
    if (this.token) {
      axios.post('http://65.21.51.17:8010/api/simbank_scheduler/check_scheduler/').then(response=>{
        const data = []
        for (let key in response.data) {
          data.push(response.data[key])
        }
        this.$store.commit('setStates', {'servers': data})
      })
      axios.post('http://65.21.51.17:8010/api/simbank/check_sims_simbank_status/').then(response=>{
        const data = []
        for (let key in response.data.simabnk) {
          data.push(response.data.simabnk[key])
        }
        this.$store.commit('setStates', {'smbs': data})
      })
    }
  }
}
</script>

